import React, { Component } from 'react';
import loginIllustration from "../Assets/images/loginIllustration.svg"

class Login extends Component {
    render() {
        return (
            <>
            <img src={loginIllustration} alt="Log in illustration" />
            </>
        );
    }
}

export default Login;
